import React from 'react';
import {Link, Outlet} from 'react-router-dom';
import './Welcome.css';

const Welcome = () => {
    return (
        <div className="div">
            <p class="p1"><b>Welcome to <span class="highlight">SpotiForums</span></b></p>
            <p class="p2"><b>All about music. All about you.</b></p>
            <div class="div2">
                <Link to="/register">
                    <button type="button" class="button1"><b>Register</b></button>
                </Link>
                <Link to="/login">
                    <button type="button" class="button2"><b>Log-In</b></button>
                </Link>
            </div>
            <Outlet />
        </div>
    )
};

export default Welcome;
